export default function Form() {
	return (
	<form className="w-96 flex flex-col items-center space-y-4 text-white">
		<input className="py-2" type="name" name="name" placeholder="Name"/>
		<input className="py-2" type="email" name="email" placeholder="Email"/>
		<input className="py-2" type="number" name="phone" placeholder="Phone Number"/>
		<textarea className="py-2" className="h-24" name="message" placeholder="Message"/>
		<button type="submit" className="bg-green-200 text-black dark:text-white rounded-md shadow-md px-8 py-4">Send</button>
	</form>
	)
}
